  \"2015-09-26T22:10:19.434819\",\n\t\"name\": \"coastal-elevation-data-from-lidar-for-us-and-territories-from-1996-to-present\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Many different partners and groups, and
  several Center-led data projects, have contributed to the lidar data collection
  housed and distributed by the NOAA Office for Coastal Management. The data span
  more than a decade and were collected using several different sensors. The collection
  includes data from topographic and bathymetric lidar sensors. Data are available
  for all of the coastal states and range from shoreline strips to full county coverage.
  The products have been delivered to the Center in various formats, projections,
  datums, and units. Once received, the data are reviewed, checked for errors, and
  standardized in a single format, projection, and datum.\",\n\t\"license_title\":
